import React from 'react';

function Home() {
    return (
        <div style={{ textAlign: "center", padding: "50px" }}>
            <h2>Welcome to ProSolver</h2>
            <p>Learn DSA concepts step by step!</p>
        </div>
    );
}

export default Home;
